import { registerIcon } from "@ui5/webcomponents-base/dist/asset-registries/Icons.js";

const name = "pushpin-off";
const pathData = "M473 168q7 9 7 18 0 11-7.5 18.5T454 212h-32l-52 52-41 165q-5 19-25 19-9 0-18-7l-89-90L76 473q-7 7-18 7t-18.5-7.5T32 454t7-18l122-121-90-89q-7-9-7-18 0-20 19-25l165-41 52-52V58q0-11 7.5-18.5T326 32q9 0 18 7zm-76-3l-50-50-68 68q-6 6-12 7l-127 32 150 150 32-127q1-6 7-12z";
const ltr = false;
const accData = null;
const collection = "SAP-icons-v5";
const packageName = "@ui5/webcomponents-icons";

registerIcon(name, { pathData, ltr, collection, packageName });

export default "SAP-icons-v5/pushpin-off";
export { pathData, ltr, accData };
